CREATE PROCEDURE dbo.proc_transform_487
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_487
    SET payload = LEFT(payload, 1000) + N'|V4-487|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_487;
END
